import Lottie from 'lottie-web'

import animation from './loadingScreen Animation.json'

const Loading = () => {

  return (
    <div>
        <Lottie
          options={{
            animationData: animation,
            loop: true,
          }}
        />
    </div>
  )
}
export default Loading
